import React from "react";
import "./Train_part.css";
import "./pexels-greg-benson-2839463-1920x1080-30fps.mp4";



function Train_part() {
    return (
        <>
            <div className="Outer_Div">
                <div className="Inner_Div">
                    <div>
                        <video controls>
                            <source src="./src\pexels-greg-benson-2839463-1920x1080-30fps.mp4" type="video/mp4" />
                            
                        </video>
                    </div>
                </div>
            </div>
        </>
    );

}
export default Train_part;
